s.\n\nLes évènements majeurs sont;\n – La cité impériale\n – Orsinium\n – Guilde des voleurs / Confrérie noir\n – Guerre Daedrique\n – Tourbevase\n – Saison du Dragon\n – Le Cœur noir de Bordeciel\n – Les Portes d'Oblivion"},[3]={name="ESO: Contenu du groupe",id=string.format("%s %s|t26:26:%s|t %s|t26:26:%s|t %s|t26:26:%s|t / |t26:26:%s|t\n\n%s\n\n%s","La section des contenus de groupe inclut la majorité des instances de groupe disponible à ce jour."," Donjons : ","/esoui/art/icons/poi/poi_groupinstance_complete.dds","Raids : ","/esoui/art/icons/poi/poi_raiddungeon_complete.dds","Arènes : ","/esoui/art/icons/poi/poi_groupinstance_complete.dds","/esoui/art/icons/poi/poi_raiddungeon_complete.dds","Il y a les versions des contenus en mode normal, vétéran et occasionnellement en mode 'difficile', avec l'exception de l'Arène de Maelstrom qui requiert uniquement le mode normal. Le Guide ne se soucie pas du mode de difficulté que vous choisirez pour compléter la quête.","Les quêtes sont cependant liées à certaines extensions. E.G La Gueule de Lorkhaj est en Marche de la Camarde, mais est sortie avec le DLC Thieves Guild, elle sera donc listée sous celui-ci.")}}}TQG.ObjectiveLevelOverview={}TQG.ObjectiveLevelOverview[1]={}TQG.ObjectiveLevelOverview[1][1]={[1]={name="Liens utiles",description="Dû à la nature des liens, des spoilers sont évidemment possibles. Vous êtes donc prévenu..."}}TQG.ObjectiveLevelOverview[1][2]={[1]={name="Liens utiles",description="Dû à la nature des liens, des spoilers sont évidemment possibles. Vous êtes donc prévenu..."}}TQG.ObjectiveLevelOverview[1][3]={[1]={name="Notes",description="La taille du groupe pour les contenus varie selon les individus. L'Arène de Maelstrom est une arène en solo, vous allez donc devoir faire face à ses horreurs tout seul.\n\n(En règle générale, les quêtes de Donjons ne sont pas répétables, cependant les quêtes de Raids le sont hebdomadairement.Vous aurez cependant uniquement à les compléter une fois pour les valider.)"